/home/panta/workspaces/thirdwave-network.query:
query CareersPageQuery {
  careersHero: file(name: {regex: "/narative-careers-hero/"}) {
    childImageSharp {
      fluid(maxWidth: 467, quality: 100) {
        ...GatsbyImageSharpFluid_noBase64
      }
    }
  }
  careersMeta: file(name: {regex: "/careers-meta/"}) {
    childImageSharp {
      fixed(width: 1200, quality: 100) {
        ...GatsbyImageSharpFixed_noBase64
      }
    }
  }
  gallery: allFile(filter: {name: {regex: "/careers-gallery/"}}) {
    edges {
      node {
        childImageSharp {
          fluid(maxWidth: 960, quality: 100) {
            ...GatsbyImageSharpFluid_withWebp_tracedSVG
          }
        }
      }
    }
  }
}

fragment GatsbyImageSharpFluid_noBase64 on ImageSharpFluid {
  aspectRatio
  src
  srcSet
  sizes
}

fragment GatsbyImageSharpFixed_noBase64 on ImageSharpFixed {
  width
  height
  src
  srcSet
}

fragment GatsbyImageSharpFluid_withWebp_tracedSVG on ImageSharpFluid {
  tracedSVG
  aspectRatio
  src
  srcSet
  srcWebp
  srcSetWebp
  sizes
}

